import React,{ Component } from 'react';
import Page1 from './admin/adpage1';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Navigate } from "react-router-dom";
class App extends React.Component
{

  constructor(props)
  {
    super(props);
    this.handleSubmit = this.handleSubmit.bind(this)
  }
  handleSubmit(){
    <Navigate to="./admin/adpage1"/>
  }
  render(){
    return(
      <div className="App">
      <>
      </>
      <header className="App-header">

        <button className='Adbutton' onClick={this.handleSubmit}>Admin</button>
        <a href="./admin/adpage1" target="_blank" rel="noopener noreferrer">
        <button>Click</button>
      </a>
        <button className='Empbutton'>Employee</button>
      </header>
    </div>
    )

  }
}


export default App;
